function ifScript() {
	var price_final_resolution = current.price_final_resolution.toString().toLowerCase();
	gs.info("TRH - price_final_resolution is " + price_final_resolution);
	if (price_final_resolution == 'keep pdi cost') {
		return 'no';
	}
	return 'yes';
}

